import InputField from '../InputField/InputField';
import './form.css';
const input_data =[
  {
    key:1,
    type:"text",
    placeholder:"First Name",
    name:"firstname",
    label:"First Name",
    required:"*"
  },
  { key:2,
    type:"text",
    placeholder:"Middle Name",
    name:"fname",
    label:"First Name",
  },
  { key:3,
    type:"text",
    placeholder:"Last Name",
    name:"lastname",
    label:"Last Name",
    required:"*"
  },
  { key:4,
    type:"date",
    placeholder:"Date Of Birth",
    name:"dob",
    label:"Date Of Birth",
    required:"*"
  },
  {
    key:5,
    type:"number",
    placeholder:"Contact No.",
    name:"contactnumber",
    label:"Contact No.",
   
  },
  { key:6,
    type:"text",
    placeholder:"Phone No.",
    name:"phonenumber",
    label:"Phone No.",
    required:"*"
  },
  { key:6,
    type:"text",
    placeholder:"Phone No.",
    name:"phonenumber",
    label:"Phone No.",
    required:"*"
  },
  { key:7,
    type:"radio",
    name:"gender",
    label:"Select Gender",
    value:"male",
    required:"*"
  },
  { key:8,
    type:"radio",
    name:"gender",
    label:"Select Gender",
    value:"female",
    required:"*"
  }

];
const Form =()=>{
return(
   <div className="container">
     <form action="" autocomplete="off">
   <div className="form-group ">
    <div className="form_title">
      <h3 className='text-center mt-5 mb-5'>Registration Form</h3>
    </div>
    
   <div className="personal-info">
    <div className="title">
      <h4>Personal Details</h4>
      <hr />
    </div> 
    <div className="row">
     {
      input_data.map((data)=>{
      return <InputField 
        type={data.type}
        placeholder={data.placeholder}
        name={data.name}
        label={data.label}
        required={data.required}
      />
      })
     }
    </div>
   
     </div>
   </div>
  </form>
   </div>
);
}
export default Form;
